        "description_id": "PROSEDUR PENGOPERASIAN SEPARATOR BAHAN BAKAR\nA.\tSTART SEPARATOR\n1.\tNyalakan power supply pada MCC di Ruang DG (MCC Load Center DG Room) dengan memposisikan knob ke (1).\n2.\tNyalakan power supply pada LCP separator dengan memposisikan knob ke on\n3.\tBuka valve M0134 (separator 1) atau Valve M0132 (separator 2) dari tanki.\na.\tPutar valve ke arah kiri untuk Valve M0134.\nb.\tPutar valve ke arah kiri untuk Valve M0132.\n4.\tBuka klep hisap Feed Pump.\n5.\tSaat power supply sudah masuk, separator pada posisi standby, tekan tombol start (warna hijau) pada LCP dan akan muncul pertanyaan ‚Äúto start feed pump press start button‚Äù, maka tekan tombol start (feed pump akan menyala selama ¬± 525 detik)\n6.\tSaat timer sudah 0 detik, akan muncul pertanyaan lagi ‚Äúto start separation press start button‚Äù, maka tekan tombol start (motor akan mulai berputar dan mulai mengajak separator untuk berputar bersama secara perlahan melalui friction pad selama ¬± 239 detik).\n7.\tKemudian akan muncul pertanyaan ‚Äú to start separation press start button ‚Äú, lalu tekan start lagi pada LCP, 3 way valve akan aktif dan separator akan mulai mendischarge / menyaring bahan bakar scr otomatis dengan mekanisme urutan sebagai berikut : \na.\tCek P244 (SV 15) : open bowl - start discharge ( 10 detik ).\nb.\tCek P232 (SV 15) : open bowl ‚Äì discharge check, draining & return increase speed ( 15 detik )\nc.\tCek P257 (SV 16) : closing bowl (15 detik ).\nd.\tCek P233 (SV 10) : water seal ( 3 detik ).\ne.\tCek P258 (V1) : 3 way valve aktif ‚Äì BB mulai disaring dan setiap 60 menit, BB kotor dan lumpur yg sudah terpisah akan dikeluarkan oleh separator dengan membuka bowl-nya.\nf.\tLalu P234 (SV 6) akan aktif untuk membuang sludge ke sludge/dirty oil tank (10 detik).\n8.\tSistem akan berjalan secara otomatis diatur oleh PLC dan mengisi ke tanki harian BB\n",
        "description_en": "FUEL SEPARATOR OPERATING PROCEDURES\nA.\tSTART SEPARATOR\n1.\tTurn on the power supply to the MCC in the DG Room (MCC Load Center DG Room) by positioning the knob to (1).\n2.\tTurn on the power supply to the LCP separator by positioning the knob to\n3.\tOpen valve M0134 (separator 1) or valve M0132 (separator 2) from the tank.\na.\tTurn the valve to the left for valve M0134.\nb.\tTurn the valve to the left for valve M0132.\n4.\tOpen the feed pump suction valve.\n5.\tWhen the power supply is in, the separator is in the standby position. Press the start button (green) on the LCP, and the question \"To start the feed pump, press the start button\" will appear. Then press the start button (the feed pump will turn on for ¬± 525 seconds).\n6.\tWhen the timer reaches 0 seconds, another question will appear: \"To start separation, press the start button,\"  then press the start button (the motor will start rotating and start inviting the separator to rotate together slowly via the friction pad for ¬± 239 seconds).\n7.\tThen the question will appear: \"To start separation, press the start button,\"  then press start again on the LCP. The 3-way valve will be active, and the separator will start to discharge or filter fuel automatically with the following sequence mechanism:\na.\tCheck P244 (SV 15): open bowl; start discharge (10 seconds).\nb.\tCheck P232 (SV 15): open bowl, discharge check, draining, and return increase speed (15 seconds)\nc.\tCheck P257 (SV 16): closing bowl (15 seconds).\nd.\tCheck P233 (SV 10): water seal (3 seconds).\ne.\tCheck P258 (V1): A 3-way valve is active: BB starts to be filtered, and every 60 minutes, dirty BB and separated sludge will be removed by the separator by opening the bowl.\nf.\tThen P234 (SV 6) will be active to dump the sludge into the sludge/dirty oil tank (10 seconds).\n8.\tThe system will run automatically, regulated by the PLC, and fill the daily BB tank.\n\n\nB.\tSTOP SEPARATOR\n1.\tThe sequence for turning off the separator is as follows:\na.\tCheck SV sludge is active (15 seconds)\nb.\tStop the timer for 1737 seconds (at this time, the motor no longer rotates the separator, but the separator will continue to rotate until it stops).\n2.\tClose the Feed Pump suction valve by positioning the lever not in the direction of the pipe.\n3.\tClose valve M0134 (separator 1) or valve M0132 (separator 2) from the tank by positioning the valve to the right.\n4.\tTurn off the power supply on the LCP separator by positioning the knob toward off.\n5.\tTurn off the power supply at the MCC in the DG Room (MCC Load Center DG Room). by positioning the knob at (0).\n"
    }
